#include <iostream>
using namespace std;

int main() {
    int k, a, b;
    cin >> k >> a >> b;
    
    if(a >= b) {
        cout << "NE" << endl;
    }
    else {
        if(k % (b - a) == 0) {
            cout << k / (b - a) << endl;
        }
        else {
            cout << "NE" << endl;
        }
    }
    return 0;
}

namespace BracketExpression
{
    internal class Program
    {
        static void Main(string[] args)
        {
            char firstSymbol = '(';
            char lastSymbol = ')';
            int count = 0;
            int maxDepth = 0;
            string text = Console.ReadLine();

            for (int i = 0; i < text.Length; i++)
            {
                if(text[i] == firstSymbol)
                {
                    count++;

                    if(count > maxDepth)
                    {
                        maxDepth = count;
                    }
                }
                else if(text[i] == lastSymbol)
                {
                    count--;

                    if(count < 0)
                    {
                        break;
                    }
                }
            }

            if (count != 0)
            {
                Console.WriteLine($"{text} - Строка не корректна");
            }
            else
            {
                Console.WriteLine($"{text} - Строка корректна. Максимальная глубина - {maxDepth}");
            }
        }
    }
}

