		if(a[i] >= '0' && a[i] <= '9')
		{
			num = num+(a[i]-'0')*n;
		}
		else if(a[i] >= 'A'&&a[i] <= 'z')
		{
			num = num+(a[i]-'A'+10)*n;
		}
		n = n*j;
	}
	
	return num;
}

int main()
{
	int n;
	scanf("%d",&n);
	while(n--)
	{
		char a[50],b[50];
		int aj,bj;
		long long at,bt;
		scanf("%s %d %s %d",&a,&aj,&b,&bj);
		//处理负数
		if(a[0] == '-') at = 0-trans(a,aj,1);
		else at = trans(a,aj,0);
		if(b[0] == '-') bt = 0-trans(b,bj,1);
		else bt = trans(b,bj,0);
		printf("%I64d\n",at+bt);
	}
}

